function SNSULELPFig(num)% SNSULELPFig -- callback implementing functions of SNSULELPDemoglobal SNSULELPFIGNUMSNSULELPInitif 1 <= num & num <= 1 ,    nihil = ~exist('SNSULELPFIGNUM');    if ~nihil,        empty = isempty(SNSULELPFIGNUM);    else        empty = 1;    end    if ~empty,        nil   = SNSULELPFIGNUM == 0;    else        nil   = 1;    end    if nil,        SNSULELPInit    end    figname = sprintf('SNSULELPFig%g',num);    clc; home; help(figname);    eval(figname);    RegisterPlot(figname,'{R}');    drawnow;    SNSULELPFIGNUM = num;elseif num==19,   % change default settings    clc; home    disp('There Are No Defaults to CHANGE');elseif num==20,   %run all figures    SNSULELPInit    for num=1:1,        figname = sprintf('aifig%g',num);        eval(figname);        RegisterPlot(figname,'{R}');        clc; home; help(figname);        drawnow;        SNSULELPFIGNUM = num;    endelse    disp('Bizarre argument in SNSULELPFig')    disp(sprintf('num =%g',num))end    %% Copyright (c) 2006. Victoria Stodden and David Donoho%  %% Part of SparseLab Version:100% Created Tuesday March 28, 2006% This is Copyrighted Material% For Copying permissions see COPYING.m% Comments? e-mail sparselab@stanford.edu%